import React, { useState, useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux'
import { setName , loadNames} from '../../store/action.js'

export function NameApp(){
    const dispatch = useDispatch()
    const names = useSelector(state => state.nameModule.names)
    // זה אותו דבר רק עם דיסטרקצ׳רינג
    const { selectedName } = useSelector(state => state.nameModule)

    useEffect(() => {
        dispatch(loadNames())
        dispatch(setName('im selected name woww'))
    }, [])

    return (
        <div>
            <p>name app</p>
            <p>{names}</p>
            <p>{selectedName}</p>
        </div>
    )
}
